import Foundation

struct WeatherData:Codable{
    var lat: Float
    var lon: Float
    var timezone: String;
    var timezone_offset: Double;
    var current:WeatherParameters;
    var hourly:[WeatherParameters];
    var daily:[DailyWeatherParameters];
    
    func getCityInfo() -> (name:String,temp:String,desc:String){
        var name = self.timezone.components(separatedBy: "/")[1]
        var temp = String(format:"%.0f",self.current.temp - 273)
        var description = self.current.weather.first?.description.capitalized ?? "Clear"
        return (name:name,temp:temp,desc:description)
    }
    
}

struct Weather:Codable{
    var id:Int;
    var main:String;
    var description:String;
    var icon:String?
}

struct WeatherParameters:Codable{
    var dt: Double;
    var sunrise:Double?
    var sunset: Double?;
    var temp:Float;
    var feels_like:Float;
    var pressure:Int;
    var humidity:Int;
    var dew_point:Float;
    var uvi:Float?;
    var clouds:Float;
    var visibility:Double;
    var wind_speed:Float;
    var wind_deg:Int;
    var weather: [Weather];
}

struct Temperature:Codable{
    var day:Float?;
    var morn:Float?;
    var eve:Float?;
    var night:Float?;
    var min:Float?;
    var max:Float?
}

struct DailyWeatherParameters:Codable{
    var dt: Double;
    var sunrise:Double?;
    var sunset: Double?;
    var temp:Temperature;
    var feels_like:Temperature;
    var pressure:Int;
    var humidity:Int;
    var dew_point:Float;
    var uvi:Float;
    var clouds:Float;
    var wind_speed:Float;
    var wind_deg:Int;
    var weather: [Weather];
}

